import React, { Component } from "react";
import Trademark from "../Trademark";
import "./styple.css";
export default class index extends Component {
  state = { sapxep: "" };

  componentDidMount() {
    const { firm } = this.props;
    if (firm != null) {
      this.setState({ sapxep: this.props.firm });
    }
  }

  render() {
    return (
      <div className="container" className="mobile">
      <section>
        {this.state.sapxep}
        <div class="row">
          <div class="">
            <Trademark type="mobile"></Trademark>
          </div>
        </div>
        <div class="row">
          <p>Đây là trang điện thoại</p>
        </div>
      </section>
      </div>
    );
  }
}
